import "./SignUpPage.scss";
import { Component } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

import SignUpInput from "../../components/SignUpInput/SignUpInput";

export default class SignUpPage extends Component {
  state = {
    error: "",
    success: false,
  };

  handleSubmit = (event) => {
    event.preventDefault();

    console.log(process.env.API_URL);

    axios
      .post(process.env.API_URL + "/", {})
      .then(() => {
        this.setState({ success: true, error: "" });
        event.target.reset();
      })
      .catch((error) => {
        this.setState({ success: false, error: error.response.data });
      });
  };

  render() {
    return (
      <main className="SignUpPage">
        <form onSubmit={this.handleSubmit}>
          <SignUpInput placeholder="First Name" type="text" id="firstName" />
          <SignUpInput placeholder="Last Name" type="text" id="lastName" />
          <SignUpInput placeholder="Email" type="text" id="email" />
          <SignUpInput placeholder="Password" type="password" id="password" />
          <SignUpInput
            placeholder="Confirm Password"
            type="password"
            id="confirmPassword"
          />
          <SignUpInput
            placeholder="Phone Number"
            type="text"
            id="phoneNumber"
          />

          <SignUpInput placeholder="Address" type="text" id="address" />

          <SignUpInput placeholder="City" type="text" id="City" />
          <SignUpInput placeholder="Dog Name" type="text" id="dogName" />
          <textarea
            className="SignUpPage__dog-info"
            name="dogInfo"
            id="dogInfo"
            rows="5"
            placeholder="Dogs information"
          ></textarea>
          {/* <Link to="/profile"> */}
          <button className="SignUpPage__button">Sign Up</button>
          {/* </Link> */}
        </form>
      </main>
    );
  }
}
